sys_hub_input_scripts.script:
{"user_list":{"scriptActive":true,"script":"// If the current value is undefined, return an empty string
// Else if the previous value is undefined, return the entire current value
// Otherwise, return the asymmetric difference between current and previous
if (!fd_data.subflow_inputs.current_value) {
 return "";
}
else if (!fd_data.subflow_inputs.previous_value) {
 return fd_data.subflow_inputs.current_value.toString();
}
else {
 var previous = fd_data.subflow_inputs.previous_value.toString().split(",");
 var current = fd_data.subflow_inputs.current_value.toString().split(",");
 return current.filter(function(currSysId) {
 return previous.indexOf(currSysId) == -1;
 }).join();
}
"}}

